Accounts_CustomFields_Description:
Sahə parametrlərinin lüğəti olan sahə adları olan qüvvədə olan JSON olmalıdır. Məsələn:<br/><code>{
"rol": {
"növü": "seçin",
"defaultValue": "tələbə",
"variantları": ["müəllim", "tələbə"],
"lazımlı": doğru,
"modifyRecordField": {
"array": doğru,
"sahə": "rollar"
}
},
"twitter": {
"tip": "mətn",
"lazımlı": doğru,
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Açar sözlər və tərcümələr olan dillərdə olan dillərdə olan düzgün JSON olmalıdır. Məsələn:<br/><code>{
"en": {
"Kanallar": "Otaqlar"
},
"pt": {
"Kanallar": "Salas"
}
}</code>
